const respuesta = {
    "estado": "aceptado"
}
var resp = pm.response.json();
pm.test('Verifico que creo el match', function() {
    pm.expect(resp.match.estado).to.be.eql(respuesta.estado)
})

const respuesta = {
    "usuario": {
        "_id": "5d5d9d94f2201e0017705234",
        "name": "Julian",
        "email": "julian@petplace.com",
        "password": "$2b$10$vZg8yFVsE4HqWWM9FtmN1uMRNZyywTCrWJxMpTtISmrQ1HWQObXLy",
        "lastname": "Villalba",
        "username": "Julian ",
        "__v": 0
    }
}
var resp = pm.response.json();
pm.test('Verifico que ingreso con el usuario', function() {
    pm.expect(resp.usuario).to.be.eql(respuesta.usuario)
})

const respuesta = {
    "_id": "5e4b1e38806cec0004289510",
    "estado": "aceptado"
}
var resp = pm.response.json();
pm.test('Acepto un Match y verifico Id y estado', function() {
    pm.expect(resp.match._id).to.be.eql(respuesta._id)
    pm.expect(resp.match.estado).to.be.eql(respuesta.estado)

})

const respuesta = {
    "msg": "The email and password don't match."

}
var resp = pm.response.json();
pm.test('Verifico que no ingreso con el usuario si esta mal la password', function() {
    pm.expect(resp.usuario).to.be.eql(respuesta.usuario)
})

var resp = pm.response.json();
pm.test('Verifico que se creo el usuario comparando el id con null', function() {
    pm.expect(resp.usuario._id).to.not.be.eql(null)
})

const respuesta = {
    "_id": "5e4b1e38806cec0004289510",
    "estado": "rechazado"
}
var resp = pm.response.json();
pm.test('Rechazo un Match y verifico Id y estado', function() {
    pm.expect(resp.match._id).to.be.eql(respuesta._id)
    pm.expect(resp.match.estado).to.be.eql(respuesta.estado)

})

const respuesta = {
     "msg": " Ya existe un usuario con este correo electrónico"
}

var resp = pm.response.json();
pm.test('Verifico que no se puede crear un usuario si ya esta registrado ese correo', function() {
    pm.expect(resp.msg).to.be.eql(respuesta.msg)
})

